from typing import List

class Solution:
    def findMaxConsecutiveOnes(self, nums: List[int]) -> int:
        n = len(nums)
        max = 0
        count = 0
        for i in range(n):
            if nums[i] == 1:
                count += 1
            else:
                if count > max:
                    max = count
                if count >= n - i:
                    break
                count = 0
            
        return max

